import logo from "../logo.svg";
import "../css/App.css";
import { useEffect, useState } from "react";
import axios from "axios";

function Home() {
    const [data, setData] = useState("");

  useEffect(() => {
    axios
      .get("http://localhost:5000")
      .then((response) => {
        setData(response.config.mess)
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);
  return (
    <div className="App">
      <header className="App-header">
        <h1>Hello World</h1>
      </header>
    </div>
  );
}

export default Home;
